window.bookSummaryJSON = "<p>Can he be what she needs?</p> <p>Getting the girl had never been a problem for Huxley Davenport. Women always flocked to him, until he met Cassie. She’s not looking for a man, but for some reason, he can’t leave her alone. Their connection is undeniable, and once he gets a taste, it’s impossible to let her go. He’s always run from commitment, but now he has to convince Cassie to give him a chance. And hope she can see past his reputation.</p> <p>The only thing Cassie Barnes ever wanted was independence. After a lifetime under someone else’s control, her oppressor is dead, and she’s ready to experience all the world has to offer. Problem is the only thing she wants to experience is the dirty talking enforcer. Hux is everything she’s ever dreamed about, and he wants her. Their quick and sexy encounter should have doused the flames, but they’re hotter than ever. Especially when it turns out he’s impossible to avoid.</p> <p>When Cassie becomes Atlanta’s newest target, Huxley refuses to let her out of his sight. Can he make it past her walls and keep her safe? Or will he lose the first woman he’s ever really cared about?</p> <p>This book contains sexual themes and violence that is intended for audiences 18 and older.</p>"; 
